  \"GREECE -- Ground-to-Rocket Electrodynamics-Electrons Correlative Experiment: High
  resolution rocket and ground-based investigations of small-scale auroral structure
  and dynamics Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:29:37.176377\",\n\t\"name\": \"greece-ground-to-rocket-electrodynamics-electrons-correlative-experiment-high-resolution-r\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rnt&lt;strong&gt;Methodology &lt;/strong&gt;The
  methodology is based on making comparisons between downward electron flux, DC electric
  fields, electromagnetic waves, and auroral morphology. The proposed project will
  launch a rocket from Poker Flat over Fort Yukon to an apogee of 200-300 km when
  arc or arcs are present that has optical shear-flows present. Data from downgoing
  electron fluxes over a large energy range, electron density (Langmuir probe), electric
  and magnetic fields from the in-situ rocket payload and images from all-sky and
  narrow field cameras at Poker Flat and Fort Yukon will be produced and analyzed.
  All instrumentation is selected so that high temporal resolution can be achieved.
  &amp;nbsp;&lt;/p&gt;rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
